import React from "react";
import "materialize-css";
import M from "materialize-css";
import { DatePicker } from "react-materialize";
import { NavLink } from "react-router-dom";

class Sent extends React.Component {
  componentDidMount() {
    // Auto initialize all the things!
    M.AutoInit();
  }
  render() {
    return (
      <>
        <main className="col s2">
            <div className="row">
                <div className="col s12 m1 offset-m11 card center">
                <NavLink to="/home" exact>
                    Home
                  </NavLink>
                </div>
            </div>
          <div className="row">
            <div className="col s6">
              <div className="col m12 card center">
              <h5>
              Sent
              </h5>
              </div>                
            <div className="col m12 card center">
                <h5 id="display">Displaying</h5>
            </div>
            </div>
            <div className="col s6">
              <div className="col m12 card center">
              <p>Displaying Each Individual Mail</p>
                <p>Diaply Mail which might be in the format of Subject and Content</p>
                <p>Hello How r u</p>
              </div>
            </div>

          </div>
        </main>
      </>
    );
  }
}

export default Sent;
